--27k segments / 157k segments <= 150 ft (~18 %)
SELECT *
FROM Results2
-- 50 FT
WHERE SegmentLength <= 0.0094697 
-- 150 FT
OR SegmentLength <= 0.0284091;

select * from results2
WHERE SegmentLength <= 0.0094697  ;

WITH A AS (
SELECT LRSID,
HIGHWAYCLASSCODE, 
AADT,
BEGINLOGMILE, 
ENDLOGMILE,
SEGMENTLENGTH,
-- when the current segment length is less than 50 ft and the current begin logmile = previous end logmile,
-- then 
CASE
	WHEN LAG(EndLogMile, 1) OVER (PARTITION BY LRSID ORDER BY BEGINLOGMILE, ENDLOGMILE) = BeginLoGMilE 
	AND Segmentlength <= 0.0094697
	THEN 'YES' ELSE 'NO'
END AS 'BEHIND',

CASE 
	WHEN LEAD(BEGINLOGMILE, 1) OVER (PARTITION BY LRSID ORDER BY BEGINLOGMILE, ENDLOGMILE) = ENDLOGMILE
	AND SEGMENTLENGTH <= 0.0094697
	THEN 'YES' ELSE 'NO' 
END AS 'FORWARD'

FROM Results2
) 

SELECT *, 
CASE WHEN BEHIND = 'NO' AND FORWARD = 'YES' THEN 'START'
	    WHEN BEHIND = 'YES' AND FORWARD = 'NO' THEN 'END'  ELSE '' END AS 'SEGPOS'
